import React from 'react';
import Map from './components/Map'
import CaseStudy from './components/CaseStudy'
import './App.css';

function App() {
  return (
    <div className="App">
      <h1> Rendering the map here! </h1>
      <Map/>
      <CaseStudy/>
    </div>
  );
}

export default App;
